import React, { NavLink } from "react";
import { Link } from "react-router-dom";

function Nav() {
  return (
    <NavLink>
      <h4>Google Books</h4>
      <Link to="/">Search</Link>

      <Link to="/saved">Saved</Link>
    </NavLink>
  );
}

export default Nav;
